import Navbar from "./Navbar";
import Head from "next/head";
import Fetch from "isomorphic-unfetch";
import Index from "../pages";
import "../pages/app.css";

const Layout = (props) => (
  <div>
    <Head>
      <title>Coinview</title>
    </Head>
    <Navbar />
    {props.children}
  </div>
);

export default Layout;
